import React from 'react';
import { GoogleLogin } from 'react-google-login';
import {withStyles, createStyles} from '@material-ui/styles';

const Login = (props) => {
    const classes = props.classes;
    const clientId = '329884307360-rn90mebdv3h7llojvlpemgi28jns1ues.apps.googleusercontent.com';

    const onSuccess = (res) => {
        console.log("Login success");

    }
    const onFailure = (res) => {
        console.log("Login failed")
    }

    return(
        <div>
            <GoogleLogin
            clientId={clientId}
            buttonText="Login"
            onSuccess={onSuccess}
            onFailure={onFailure}
            cookiePolicy={'single_host_origin'}
            style={{marginTop: '100px'}}
            isSignedIn={true}
            />
        </div>
    )
}

